import React from 'react';
import Navbar from './components/layout/Navbar';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import './App.css';

const App = () => {
  return (
    <BrowserRouter>
      <div className='App'>
        <Navbar />
      </div>
    </BrowserRouter>
  );
};

export default App;
